import { Button } from "@mui/material";
import React from "react";

const ButtonOnUp = () => {
  const onUp = () => {
    window.scrollTo(0, 0);
  };
  return (
    <Button
      variant="contained"
      color="secondary"
      onClick={() => onUp()}
      sx={{ borderRadius: "50%" }}
    >
      UP
    </Button>
  );
};

export default ButtonOnUp;
